  int ai[2];
  int j;
  for (j = 0; j < 2; j++)
    ai[j] = 8;
  for (w = 1;;) {
    for (; j < 4; j++) {
    }
    for (af = 6; af >= 0; af -= 1)
      v = ai[0] ^= ad[w + 1][w][af] = fn4(fn2(1, fn2(3, u--)), 4294967295);
    return ae;
  }
}
int main() {
  fn9();
  f = ad[2][1][0];
  printf("checksum = %x\n", f);
  return 0;
}
